	('20899', '5793', 'When I close the socket it always going to close wait state which is disturbing the communication', '\r\nI need information about DNP3 Communication. When Network/Ethernet communication is inactive for sometime and reconnected does DNP3 automatically establishes the communication?\r\n\r\nIn my case, when communication failure occurred for sometime and reconnected DNP3 communication is not happening.\r\n\r\nWhen I verified code the socket is in \'Established\' State even network communication is inactive then I tried to close the socket connection.', '2024-05-14 10:40:21'),
	('22269', '6125', 'Problems with invoking ttkbootstrap Tableview', '0\r\n\r\nI am running the example code for ttkbootstrap TableView:\r\n\r\nimport ttkbootstrap as ttk\r\nfrom ttkbootstrap.tableview import Tableview\r\nfrom ttkbootstrap.constants import *\r\n\r\n\r\napp = ttk.Window(themename = "superhero")\r\ncolors = app.style.colors\r\n\r\ncoldata = [\r\n    {"text": "LicenseNumber", "stretch": False},\r\n    "CompanyName",\r\n    {"text": "UserCount", "stretch": False},\r\n]\r\n\r\nrowdata = [\r\n    (\'A123\', \'IzzyCo\', 12),\r\n    (\'A136\', \'Kimdee Inc.\', 45),\r\n    (\'A158\', \'Farmadding Co.\', 36)\r\n]\r\n\r\ndt = Tableview(\r\n    master=app,\r\n    coldata=coldata,\r\n    rowdata=rowdata,\r\n    paginated=True,\r\n    searchable=True,\r\n    stripecolor=(colors.light, None),\r\n)\r\ndt.pack(padx=10, pady=10)\r\n\r\napp.mainloop()\r\n\r\n\r\ndt.insert_row(\'end\', [\'Marzale LLC\', 26]) \r\nHowever I consistently get a TclError: can\'t invoke "tk" command: application has been destroyed message. I am running Python 3.11.7. I can\'t work out at all where the error is coming from. Any pointers would be much appreciate. Thanks!\r\n', '2024-05-14 10:48:45'),
	('25325', '2761', 'Filtering by number of comments in GitHub Search API', 'I am trying to pull issues from the github tensorflow repo, that have more than 250 comments. However, I always receive 30 results (in accordance with GitHubs Pagination), when I should only receive 2 results. Here\'s my code:\r\n\r\nowner = "tensorflow"\r\nrepo = "tensorflow"\r\nn_comments = 250\r\nurl = f"https://api.github.com/repos/{owner}/{repo}/issues"\r\n\r\ntoken = "mytokenhere"\r\n\r\nparams = {\r\n    \'sort\':\'comments-desc\',\r\n    \'q\': \'comments:>{n_comments}\',\r\n}\r\n\r\nheaders = {\r\n    "Authorization": f"token {token}",\r\n    "Accept": "application/vnd.github.v3+json" # specifying json-formatted data\r\n}\r\n\r\nresponse = requests.get(url, headers = headers, params = params)\r\n\r\nissues_with_sufficient_comments = []\r\n\r\nif response.status_code == 200:\r\n    # Extract the JSON data\r\n    data = response.json()\r\n    \r\n    for item in data:\r\n        issues_with_sufficient_comments.append(item[\'number\'])\r\n        print(item[\'number\'])\r\n        print(item[\'comments\'])\r\n    \r\nelse:\r\n    # Print error message if request failed\r\n    print(f"Error: {response.status_code}")\r\n\r\nI also tried url = f"https://api.github.com/repos/{owner}/{repo}/issues?q=comments:>250", which did not help eithe', '2024-05-14 10:38:45'),
