	('2747', '7021', 'VS Professional not searching for CMakeLists.txt in subfolders', 'I have a main folder with multiple subfolders, each with its own project and CMakeLists.txt. When I open VSP in a specific project folder, it recognises it as a CMake project and I can configure it. When I open the top-level directory, VSP doesn\'t search for CMakeLists.txt in the sub-directories and I can\'t configure any project. How do I fix this?', '2024-05-14 10:45:07'),
	('39342', '8197', 'My not getting correct solution after checking condition is correct', 'I created the questions Like :\r\n\r\n"What time did you go to bed?" Intent : bedtime set with Parameters: Parameter id: bedtime, Entity type: @sys.date-time Is list: Redact in log:\r\n"At what time did you wake up?" Intent : wakeup_time set with Parameters: Parameter id: wakeup_time, Entity type: @sys.date-time Is list: Redact in log: after this several 3 general questions with Yes/No intent, finally\r\nIt looks like you are finding it hard to stay asleep, is that correct? Intent : Yes/No in this inside yes/no intent I gave the Condition rules--> Customize expression: " $sys.func.DATETIME_DIFF($session.params.wakeup_time, $session.params.bedtime, "HOURS") > 7" So, After checking the condition I gave relevant solution as intent values in next page if it\'s more 7 hours it progress to more_than_7_hours solution and if it\'s less than 7 hours progress to less_than_7hours solution.', '2024-05-14 10:46:23'),
